import React, { Component } from 'react'

export class RenderCommanPropsCOunter extends Component {
    
        constructor(props) {
            super(props)
        
            this.state = {
                 Count:0
            }
            
        }
        IncrementCounter=()=>{
            this.setState(prv=>{
                return{Count:prv.Count+1}
            })
        } 
    render() {
        alert()
        return (
            <div>
                {this.props.render(this.state.Count,this.IncrementCounter)}
            </div>
        )
    }
}

export default RenderCommanPropsCOunter
